import React, { Component } from 'react';
import axios from 'axios';

export default class appContainer extends Component {
  state = {
    users: [],
  };

  componentDidMount() {
    axios.get(`http://localhost:3000/songs`).then((res) => {
      const songs = res.data;
      this.setState({ songs });
    });
  }

  render() {
    return (
      <ul>
        {this.state.songs.map((user) => (
          <li>{user.username}</li>
        ))}
      </ul>
    );
  }
}
